import React from 'react';
import AyungonHeader from '../assets/AyungonHeader.png';
const Navbar = () => {
	return (
		<div className="flex bg-green-600 w-screen justify-between">
			<div>
				<img
					className="w-80 p-3"
					src={AyungonHeader}
					alt=""
				/>
			</div>

			<div>
				<h2></h2>
			</div>
		</div>
	);
};

export default Navbar;
